      // console.log("button clicked");
        this.setState({
            count : this.state.count +1
        })
    }


  render() {
    return (
      <div>
        <h1>count:</h1>
    <button onClick={() => this.changeCount()}>Increase</button>

      </div>
    )
  }}

export default Counter
